import { useState } from 'react';
import { NavLink } from 'react-router-dom';
import './App.css';
import Header from './Header';

const App = () => {

  return (
    <div class="vstack gap-3 container">

      <Header />

      <div class="col-md-6">
        <h3>Registrer ny matvare</h3>
      </div>

      <div class="col-12 button-div">
        <NavLink to="/calculator" className="btn btn-primary btn-lg button-search">Webkalkulator</NavLink>
      </div>

    </div>

  )
};



export default App;
